import React from 'react';
import styled from 'styled-components';

const Head = styled('div')`
  font-size: 40px;
  color: yellow;
  font-family: 'Rubik Mono One', sans-serif;
  text-align: center;
  padding-top: 250px;
`;

export default Head;
